script: |
  super -f text -I q10542.spq | sort > q10542.out

inputs:
  - name: q10542.spq
    data: |
      SELECT ALL col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NULL NOT IN ( + - col2 * - - col2 - + CAST ( - CAST ( NULL AS INTEGER ) AS INTEGER ) / + col0 );
  - name: tab0

outputs:
  - name: q10542.out
    data: |
